const loadMode = () => {

    tempString = ``;

    tempString += `<div class = "modeCard" onClick = "changeMode(${true})" style="${checkMode(0)}; position:absolute; left:1vw; top:2.2vh;">
    <img class = "card-image" src="${pokemonCacheRO[337].image}"/>
    <h2 class = "modeFont" style = "color: white";>Light Mode</h2>
   </div>`;

   tempString += `<div class = "modeCard" onClick = "changeMode(${false})" style="${checkMode(1)}; position:absolute; left:6.5vw; top:2.2vh;">
   <img class = "card-image" src="${pokemonCacheRO[336].image}"/>
   <h2 class = "modeFont">Dark Mode</h2>
  </div><br></br>`;

    tempString += `<div class="evoButtonCard" style = "right: 30vw; border: ${checkColorFont(true)};"onClick = "evoButton()">
    <h2 class="evoButtonFont">Fully Evolved Only ${returnFullEvoText()}</h2>
    <img class = "card-image" style = "scale: .8; position: relative; top: -16vh;" src="${returnEeveeImage()}"/>
</div>`;

    tempString += `<div class="evoButtonCard" style = "right: 25vw; border: ${checkColorFont(true)};" onClick = "toggleBSTMode()">
    <h2 class="evoButtonFont">BST-Weighted ${returnBSTWeightText()}</h2>
</div>`;


  tempString += `<h1 style = "position:absolute; top:4.5vh; color: ${checkColorFontBW(false)};">Ironmon Coverage Calc</h1>`;

   brightmode.innerHTML = tempString;
}

const returnFullEvoText = () => {
    if(fullEvolvedOnly){
        return `(On)`;
    } else {
        return `(Off)`;
    }
}

const returnBSTWeightText = () => {
    if(bstWeightedOn){
        return `(On)`;
    } else {
        return `(Off)`;
    }
}

const returnEeveeImage = () => {

    if(!fullEvolvedOnly){
        eeveeCounter += 1;
        return pokemonCacheRO[132].image;
    }

    if(eeveeCounter >= 9){
        eeveeCounter = 1;
    }
    
    switch (eeveeCounter) {
        case 1:
            return pokemonCacheRO[133].image; 
            break;
        case 2:
            return pokemonCacheRO[134].image; 
            break;
        case 3:
            return pokemonCacheRO[135].image; 
            break;
        case 4:
            return pokemonCacheRO[195].image; 
            break;
        case 5:
            return pokemonCacheRO[196].image; 
            break;
        case 6:
            return pokemonCacheRO[469].image; 
            break;
        case 7:
            return pokemonCacheRO[470].image; 
            break;
        case 8:
            return pokemonCacheRO[699].image; 
            break;
        default:
            return unownQimage;
            break;
    }
}

const changeMode = (bool) => {

    lightModeOn = bool;

    if(lightModeOn){
        document.body.style.backgroundColor = "azure";
        document.getElementsByTagName('H1')[0].style.color = "black";
    } else {
        document.body.style.backgroundColor = "#121212";
        document.getElementsByTagName('H1')[0].style.color = "white";
    }

    loadMode();
    reloadCalc();
}

const checkMode = (num) => {

    if(num == 0){
        if(!lightModeOn){
            return `opacity: .4`;
        } else {
            return `opacity: 1`;
        }
    }

    if(num == 1){
        if(lightModeOn){
            return `opacity: .4`;
        } else {
            return `opacity: 1`;
        }
    }
}

const checkColorFont = (yellow) => {
    if(faqModeOn && yellow){
        return "5px solid blue;";
    }

    if(lightModeOn){
        return "1px solid #000000;";
    } else {
        return "1px solid #FFFFFF;";
    }
}

const checkColorTypeSel = () => {
    if(lightModeOn){
        return "black";
    } else {
        return "white";
    }
}

const checkColorCombos = () => {
    if(lightModeOn){
        return "azure";
    } else {
        return "#121212";
    }
}

const loadPokemon = () => {

    cacheEvos();
    cachePokemon();
    cacheAltForms();
    
};

